set number_seats:= (select a.total_number_of_seats from airplane a,flight_instance i where a.airplane_id= i.airplane_id and i.flight_number = new.flight_number);
set reserved_seats:=(select count(1) from seat_reservation s where s.flight_number=new.flight_number);

  if(number_seats - reserved_Seats<=0) then
