/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `seat_reservation_check_2` AFTER INSERT ON `seat_reservation` FOR EACH ROW begin
declare number_avail_seats integer;
declare new_num_seats integer;

set number_avail_seats:= (select i.number_of_available_seats from flight_instance i where i.flight_number = new.flight_number);
set new_num_seats:=number_avail_seats-1;

  update flight_instance i set i.number_of_available_seats=new_num_seats where i.flight_number = new.flight_number;

END */;;
